import React, { useState,useContext } from "react";
import {View, Text, TextInput, StyleSheet, Button, Modal, TouchableOpacity} from 'react-native';
import Title from "./Title";
//import { AuthContext,IAuthContext } from "./providers/AuthProviders";

const SignUP = ({navigation}:{navigation:any}) =>{
    const[firstName,setFirstName] = useState('');
    const[lastName,setLastName] = useState('');
    const[email,setEmail] = useState('');
    const[pass,setPass] = useState('');
    
    
    const[firstNameError, setFirstNameError] = useState(false);
    const[lastNameError, setLastNameError] = useState(false);
    const[emailError, setEmailError] = useState(false);
    const[passError, setPassError] = useState(false);
    // const handleSubmit =(auth:IAuthContext)=>{ 
        const handleSubmit = ()=>{  
          //form validation  
          if(!firstName){
            setFirstNameError(true)
        }else{
            setFirstNameError(false)
        }
        if(!lastName){
            setLastNameError(true)
        }else{
            setLastNameError(false)
        }
        if(!email){
            setEmailError(true)
        }else{
            setEmailError(false)
        }
        if(!pass){
            setPassError(true)
        }else{
            setPassError(false)
        }
        if(firstName==="Indrani"&& lastName==="Sarker" && email === "indranisarker7@gmail.com" && pass === "1234"){
            console.warn("Successfully SignUp!")
            //auth.setIsLoggedIn(true)
            navigation.navigate('Login');
        }else{
            //auth.setIsLoggedIn(false)
            console.warn("Invalid SignUP")
        }
    }
  
        return(
            <View style={styles.container}>
                <Title/>
        
                <Text style={{fontSize:30, fontWeight:'600', marginBottom:20, color:'#fff'}}>SignUp</Text>
                     <View style={styles.modalView}>
                     <TextInput style={styles.input} placeholder="Enter First Name" 
                        onChangeText={(firstName)=>setFirstName(firstName)}></TextInput>
                        {firstNameError? <Text style={styles.errorText}>Please fill the first name field!</Text>:null}
                        <TextInput style={styles.input} placeholder="Enter Last Name" 
                        onChangeText={(lastName)=>setLastName(lastName)}></TextInput>
                        {lastNameError? <Text style={styles.errorText}>Please fill the last name field!</Text>:null}
                        <TextInput style={styles.input} placeholder="Enter Email" 
                        onChangeText={(email)=>setEmail(email)}></TextInput>
                        {emailError? <Text style={styles.errorText}>Please fill the email field!</Text>:null}
                        <TextInput style={styles.input} placeholder="Enter Password"
                        secureTextEntry={true} onChangeText={(pass)=>setPass(pass)}></TextInput>
                        {passError? <Text style={styles.errorText}>Please fill the password field!</Text>:null}
                        <TouchableOpacity style={styles.button}
                        //  onPress={()=>handleSubmit(auth)}>  
                        onPress={handleSubmit}>               
            <Text style={styles.buttonText}> SignUp</Text>
            
         </TouchableOpacity>
         <View style={{ flexDirection: 'row', alignItems: 'center', padding: 5 }}>
            <Text style={{ fontSize: 18 }}>Already have an account? </Text>
            <TouchableOpacity onPress={()=>navigation.navigate('Login')}>
        <Text style={{ color: 'blue' ,fontSize:18}}>Login</Text>
            </TouchableOpacity>
</View>

         </View>
             </View>
        )
    }
    const showSuccessMessage = ()=>{
        return(
            <>
            <Text>Successfully Logged In</Text>
            </>
        )
    }
    // return(
    //     <AuthContext.Consumer>
    //         {(auth)=>
    //         <View style={styles.container}>
    //             <Title/>
    //         {!isLoggedIn? showLoginInfo(auth as IAuthContext):showSuccessMessage()}
    //         </View>
    //         }
            
    //     </AuthContext.Consumer>
    // )
    

const styles = StyleSheet.create({
   container:{
    backgroundColor: '#00798c',
    alignItems: 'center',
    justifyContent: 'center',
    marginTop:25,
    marginLeft:10,
    marginRight:10,
    borderRadius:10,
    height:'100%'
    
   },
modalView:{  
    marginBottom:180,
    justifyContent:'center',
    alignItems:'center', 
    width:300,
    height:450,
    backgroundColor:'white',
    borderRadius:20,
    shadowColor:'#bbb',
    shadowOpacity:0.80,
    elevation:5
},
input:{
    borderWidth:1,
    borderColor:'skyblue',
    borderRadius:10,
    padding:10,
    width:250,
    marginBottom:10
},
button:{
    width:150,
    height:50,
    backgroundColor:'#00b4d8',
    padding:10,
    borderRadius:15,
},
buttonText:{
    color:'#fff',
    fontSize:20,
    justifyContent:'center',
    alignItems:'center',
    textAlign:'center'
    
},
errorText:{
    width:250,
    marginBottom:10,
    color:'red'
}
})
export default SignUP;
